function getColor_popfr(d){

	    if(_.contains(tres_prio,d)) { return '#124B3D'; }
	    if(_.contains(prio,d)) {return '#2A715F' ;}
		if(_.contains(peu_prio, d)) { return  '#8DC1B4';}
		if(_.contains(non_prio, d)) { return  '#E9F6F2';}



}


function getStyle(d){
	if (type=="Priorisation") { return getColor_prio(d)};
	if (type=="Agriculteurs") { return getColor_agriculteurs(d)};
	if (type=="Chomeurs") { return getColor_chomeurs(d)};
	if (type=="Population") { return getColor_popfr(d)};
}

function style(Code_BDV) {
    return {
        fillColor: getStyle(Code_BDV),
        weight: 1,
        opacity: 1,
        color: 'black',
        // dashArray: '1',
        fillOpacity: 0.8
    };
}




